import React from 'react'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './Footer.css';

function Footer() {
  return (
    <footer className='footer-bg'>
      <Container>
        <Row>
          <Col xs={12} md={8}>
            <Row></Row>
          </Col>
          <Col xs={12} md={4}>
            xs=6 md=4
          </Col>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
